Δεδομένου ότι γίνεται όλο και χειρότερο με γεωμετρικη πρόοδο όπως δείχνει Επομένως, πρέπει να ισχύει ότι "Σιγά σιγά χειροτερεύει."; Ναι, όχι, ή ίσως;
Μπορεί

Δεδομένου ότι Το Limpiar σημαίνει να καθαρίσει, και μια limpia είναι παρόμοια με μια barrida. Επομένως, πρέπει να ισχύει ότι "Αν και η barrida και η limpia είναι παρόμοιες, υπάρχουν πολλά πράγματα που τις διακρίνουν μεταξύ τους."; Ναι, όχι, ή ίσως;
Μπορεί

Δεδομένου ότι Παρόλα αυτά τα αυστηρά νομοθετικά πρότυπα με τα επίπεδα μισθών που ενημερώνονται που και που, οι διαδεδομένες παραβιάσεις στους χώρους εργασίας ενδυμάτων ήταν συνηθισμένοι στη δεκαετία του 1990. Επομένως, πρέπει να ισχύει ότι "Δεν υπάρχουν αρκετοί επιθεωρητές για την παρακολούθηση των παραβιάσεων στα τμήματα ενδυμάτων."; Ναι, όχι, ή ίσως;
Μπορεί

Δεδομένου ότι Εντάξει και κάνουν καλά λαζάνια Επομένως, πρέπει να ισχύει ότι "Τα λαζάνια τους είναι εξαιρετικά."; Ναι, όχι, ή ίσως;
Ναί

Δεδομένου ότι έχεις διαβάσει Τη Φίρμα Επομένως, πρέπει να ισχύει ότι "Διάβασες το βιβλίο Η Εταιρία;"; Ναι, όχι, ή ίσως;
Ναί

Δεδομένου ότι Το αφοσιωμένο επαγγελματικό προσωπικό, με επικεφαλής τον Philip Zelikow, συνέβαλε αμέτρητες ώρες στην ολοκλήρωση αυτής της έκθεσης, θέτοντας κατά μέρος άλλες σημαντικές προσπάθειες για να αναλάβει αυτή την πολύ απαιτητική αποστολή. Επομένως, πρέπει να ισχύει ότι "Ήταν είκοσι άτομα στο προσωπικό του Philip Zelikow."; Ναι, όχι, ή ίσως;
Μπορεί

Δεδομένου ότι Λοιπόν, δεν το σκέφτηκα καν, αλλά ήμουν τόσο απογοητευμένος, και κατέληξα να του μιλάω και πάλι. Επομένως, πρέπει να ισχύει ότι "Δεν του μίλησα ξανά."; Ναι, όχι, ή ίσως;
